import React from 'react';
import PropTypes from 'prop-types';
import 'antd/dist/antd.css'

const NodeBird = ({Kigkm}) => {
    return(
        <>
        <div>공통메뉴</div>
        <Kigkm />
        </>
    )
}
NodeBird.propTypes = {
    Kigkm: PropTypes.element.isRequired,
}

export default NodeBird
